import React from "react";
// import classes from "./NavBar.module.css";
// import Button from "@material-ui/core/Button";
// import Grid from "@material-ui/core/Grid";
// import ButtonGroup from "@material-ui/core/ButtonGroup";
import classes from "./NavBar.module.css";
import { Link } from "react-router-dom";
import { Navbar, Nav, Form, Button, ButtonGroup } from "react-bootstrap";

const NavBar = (props) => {
  return (
    <Navbar bg="light" expand="lg" className={classes.NavBar}>
      <Navbar.Brand>VIP Flood Sensor Research Group</Navbar.Brand>
      <Navbar.Toggle aria-controls="basic-navbar-nav" />
      <Navbar.Collapse id="basic-navbar-nav">
        <ButtonGroup>
          <Button variant="light">
            <Link to="/">About</Link>
          </Button>
          <Button variant="light">
            <Link to="/intro">Demo</Link>
          </Button>
          <Button variant="light">
            <Link to="/asd">Team</Link>
          </Button>
        </ButtonGroup>
      </Navbar.Collapse>
    </Navbar>
  );
};

export default NavBar;
